import './App.css';
import data from "./data" ; 
import ListCoin  from "../instructions/cryptoToken"


function App() {
  return (
    <div className='ListCrypto'> 
     <ul> 

    { 
      data.map(token => (
        <li key={token.nameCoin}>
        <h1>{token.nameCoin} </h1> 
        < ListCoin nameCoin={token.nameCoin} ticker={token.ticker} /> </li>

      ))
    }
    </ul>








    </div>
  );
}

export default App;
